V8:
ÇOX TƏCILI olduğundan dəyərindən ÇOX UCUZ QİYMƏTƏ satılır. İnanılmaz ucuz qiymətə.
Sabit Rəhman küçəsində. Nərgiz klinikası ilə üzbə-üz PİLOT layihəli bina PREMİUM RESİDENS şirkəti tərəfindən inşaa edilmişdir.
Bina Səməd Vurgun küçəsi ilə Həsən Əliyev küçəsinin kəsiçməsinə, Asan 1 xidmətinə və Tibb universitetinə yaxin ərazidə yerləşir.Binada yaşamaq ücün hər şərait mövcuddur, hazirda mənzillərin əksəriyyətində yaşayiş var.Mənzilin sahəsi 157kv.dir, mənzil: qonaq otağı iki yataq otağı, mətbəx, geniş holl, 3 sanitar qovşağı və 3 balkondan ibarətdir. Mənzil keyfiyyətlə və zövqlə təmir edilmişdir, pol parketdir mənzildə təmirdən sonra yaşayış olmayıb, ÇIXARIŞ (kupça) var qeydiyyatda adam yoxdur.
Qaz, su, işıq var
Telefon, internet, kabel tv var.
Qapalı həyət, 24 saat mühafizə və müşahidə kameraları;
Kart buraxılış sistemi;
Yeraltı parkinq;
Parkinqdən birbaşa liftə daxil olma imkanı;
Mərkəzləşdirilmiş yanğın əleyhinə sistem;
Ehtiyat generatorlar sistemi;
24 saat su təchizatı və su çəni var
QAZ, SU, ISIQ DAIMIDIR. Bütün sənədlər qaydasındadır, ALQI-SATQIYA və İPOTEKAYA tam yararlı bir mənzil.(Mənzil ipotekada deyil, ipotekaya yararlıdır). KUPCALIDIR.
Allah alanada satanada xeyir versin.
